import React from 'react';
import '../Styles/Contact.css';

const Contact = () => {
  return (
    <section className="contact-section">
      <h2>Contact</h2>
      <p>Email: <a href="mailto:suraj.b9930@gmail.com">suraj.b9930@gmail.com</a></p>
      <p>Phone: 9767661236</p>
      <p>GitHub: <a href="https://github.com/surajbhandwalkar" target="_blank" rel="noopener noreferrer">github.com/surajbhandwalkar</a></p>
      <p>Location: Pune, India</p>
      <P>Linkdin:</P>
    </section>
  );
};

export default Contact;
